* Objects returned needs to be stringfied. Ex.: JSON.stringify(inputVariable1);
**/
function run(data) {
	let reposArray = (JSON.parse(data)).repos;
	if(!reposArray){
		return "0";
	} else {
	return JSON.stringify(reposArray.length);
	}
}

